import Comment from "./Comment";

function CommentList(props) {

    return (
        <div>
            <div>{props.length} Comment(s)</div>
            {props.comments.map(comment =>

                <Comment
                    user={comment.user}
                    rating={comment.rating}
                    comment={comment.comment}

                />

            )
            }
        </div>
    );


}

export default CommentList
